/* eslint-disable */

// polyfill => It will make some JavaScript features work in older broswers as well
import '@babel/polyfill';
import { displayMap } from './mapbox';
import { login, logout } from './login';
// import {updateSettings} from './updateSettings'
import { signup } from './signup';

// DOM ELEMENTS
const mapBox = document.getElementById('map');
const loginForm = document.querySelector('.form');
const logOutBtn = document.querySelector('.nav__el--logout');
// const userDataForm = document.querySelector('.form-user-password');
// const userPasswordForm = document.querySelector('.form-user-password');
const signupForm = document.querySelector('.form--signup');

// DELEGATION
// We use if because the locations exists only in tour page, so in other pages it will make error
if (mapBox) {
  const locations = JSON.parse(mapBox.dataset.locations);
  displayMap(locations);
}

// We use if for the case the loginForm will not exists in other pages
if (loginForm)
  loginForm.addEventListener('submit', (e) => {
    e.preventDefault();

    const email = document.getElementById('email').value;
    const password = document.getElementById('password').value;
    login(email, password);
  });

if (logOutBtn) logOutBtn.addEventListener('click', logout);

if (signupForm) {
  signupForm.addEventListener('submit', (e) => {
    e.preventDefault();
    const name = document.getElementById('name').value;
    const email = document.getElementById('email').value;
    const password = document.getElementById('password').value;
    const confirmPassword = document.getElementById('password-confirm').value;
    signup(name, email, password, confirmPassword);

    // const navLinks = document.getElementsByClassName('.nav__el');
    // navLinks.addClass('.nav__el--cta');
  });
}

